section-5/5-6.html.body:
Install MySQL and Run Stuff
We're gonna start by logging in to our HDP VM.
We want to access mysql:
mysql -u root -p
Password is hadoop.
Now we run:
create database movielens;
show databases;
exit;
Now we need to download the MovieLens data using the following command:
wget http://media.sundog-soft.com/hadoop/movielens.sql
It's basically a file with a lot of sql. 
Now we need to upload it!
mysql -u root -p
        hadoop

SET NAMES 'utf8';
SET CHARACTER SET utf8;
use movielens;
source movielens.sql;
SHOW tables;

SELECT * FROM movies LIMIT 10;

DESCRIBE ratings;
We can now try to recreate what we did with HIVE.
SELECT movies.title, COUNT(ratings.movie_id) AS ratingCount
FROM movies
INNER JOIN ratings
ON movies.id = ratings.movie_id
GROUP BY movies.title
ORDER BY ratingCount;
We have the same answer - it was much faster! Because this dataset is quite tiny... 
If you have real datasets with millions of ratings, it's not as useful, you can cache everything in memory, etc.

section-6/6-10.html.body:
MongoDB Shell
Now we'll use the shell with mongodb. To do that we open our terminal, and type:
mongo
In the interactive mongo shell now we can query our data:
use movielens

// Very javascript-y function
db.users.find( { user_id: 100 } )

// Now we can do more exploration in that query
db.users.explain().find( { user_id: 100 } )

// We can see that all is doing is a COLSCAN, going one record at a time until it finds it
// To fix this we can make an index
// The 1 stands for ascending
db.users.createIndex( { user_id: 1 } )

// Now let's do the same explain plan again
db.users.explain().find( { user_id: 100 } )

// Now instead of an index scan, its finding the query
// let's try it again
db.users.find( { user_id: 100 } )

If you forget to add a key, your database is going to be extremely slow.
Cool / complex stuff to do
There are things that you would need hadoop to do, but you can do it in mongo.
Answer the question of : what is the average age of X?
db.users.aggregate([
    { $group: { _id: { occupation: "$occupation", avgAge: { $avg: "$age"}}}}
])

We can see that it finished extremely fast, giving us the average age per occupation.
// We can also find out how many users in db.
db.users.count()

// Collections
db.getCollectionInfos()

// Now let's drop it
db.users.drop()

// Let's check if we cleaned
db.getCollectionInfos()

Now let's make sure that we shut down mongo gracefully, otherwise we'll be introuble.
In the Ambari interface we go to Services > MongoDB, and press Actions>Stop.
If stops successfully we'll be able to safely quit everything!

section-7/7-9.html.body:
Presto Cassandra integration
Boot up the terminal, and enable python 2.7
scl enable python27 bash

python -V
Now we can start cassandra service
service cassandra start
And we need to enable the thrift server with cassandra.
nodetool enablethrift
We should check if our database is still there
cqlsh --cqlversion="3.4.0"

describe keyspaces;

use movielens;

describe tables;

select * from users limit 10;

quit
We have data!
So let's connect it to presto, and then use queries with presto that merges hive with cassandra.
cd etc/catalog
now we need to configure properties with vim cassandra.properties and enter:
connector.name=cassandra
cassandra.contact-points=127.0.0.1
Now let's go to our catalog
cd ../..
bin/launcher start
And now we should be able to start querying 
show tables from default;
select * from default.ratings limit 10;
select * from default.ratings where rating = 5 limit 10;
select count(*) from default.ratings where rating=1;
show tables from cassandra.movielens;
describe cassandra.movielens.users;
select u.occupation, count(*) from hive.default.ratings r join cassandra.movielens.users u on r.userid = u.user_id group by u.o
Finally, it's also possible to connect many other types of databases!
